import React from "react";
import Card from "./Card";
import Certificate_1 from "./assets/certif-1.png";
import Certificate_2 from "./assets/certif-2.png";
import Certificate_3 from "./assets/certif-3.png";




const Certif=()=>{
    return(
      <>
      <div className="container">
     <Card imgsrc={Certificate_1} title="p"/>
     <Card imgsrc={Certificate_2} title="pic2"/>
      </div>

      <h1 className="certif-heading">
       Explore my Linkedin for more!!
      </h1>
      <div className="container">
     <Card imgsrc={Certificate_3} title="🍂 Celebrating a fruitful October! 🎉 Just wrapped up hashtag#hacktoberfest2023 , and I'm thrilled to have successfully completed the challenge by submitting four meaningful pull requests and becoming part of Hacktoberfest hall of fame 2023. 🚀 It was a fantastic journey of contributing to open-source projects and collaborating with the global developer community. "/>
      </div>


      </>
    );
}
export default Certif;
